    return(
    <div>
        <Card
         cover={postMessage.Images[0] &&<PostImages images={postMessage.Images} />}
         action={[
             <RetweetOutlined/>
         ]}
        
        >
            <Image/>
            <Content />

        </Card>
        <CommentForm/>
        <Comments/>
         
         
    </div>
    );
};

export default PostCard;
